css:
.header-view {
  position: fixed;
  width: 100%;
  z-index: 10;
  position: relative;
}
.header-view .heading-close {
  color: #ffffff;
}
.header-view .heading-title {
  padding-left: 6px;
}
.header-view .heading-status {
  padding-left: 9px;
}
.header-view .icon-alert {
  color: #ff982d;
}
.header-view .icon-check {
  color: #2bda77;
}
.header-view .icon-hourglass {
  color: #aaaaaa;
}
.header-view .icon-stop {
  color: #cc0000;
}
.script-view {
  overflow: scroll;
  max-height: 300px;
  height: auto;
  margin-bottom: 0px;
}
.script-view .panel-body pre {
  background: #1d1f21;
  color: #aaaaaa;
}
.script-view .stderr {
  color: #cc0000;
}
.script-view .line {
  border-radius: 0px;
  margin: 0px;
  padding: 0px;
}
